import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import OsobaList from './components/OsobaList';

const KliknijPage = () => {
    return (
        <div>
            <h2>Strona z przyciskiem "Kliknij"</h2>
            <Link to="/osoby">Przejd≈∫ do tabeli z osobami</Link>
        </div>
    );
};

function App() {
    return (
        <Router>
            <div className="App">
                <h1>Aplikacja</h1>
                <Routes>
                    <Route path="/" element={<KliknijPage />} />
                    <Route path="/osoby" element={<OsobaList />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
